import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Authentication from './components/Authentication';
import Settings from './components/Settings';
import EditProfile from './components/EditProfile';
import LoginAndSecurity from './components/LoginAndSecurity';
import ForgotPassword from './components/ForgotPassword';
import Dashboard from './components/Dashboard';
import DisposeMenu from './components/DisposeMenu';
import DisposeForm from './components/DisposeForm';
import TrackOrder from './components/TrackOrder';
import Profile from './components/Profile';
import ProtectedRoute from './components/ProtectedRoute';
import Rewards from './components/Rewards';
import CustomerSupport from './components/CustomerSupport';
// import AboutUs from './components/AboutUs';
// import Header from './components/Header';
// import Footer from './components/Footer';

function App() {
  const [user, setUser] = useState({
    name: 'Manyatha',
    profilePicture: 'https://via.placeholder.com/150'
  });

  const handleLoginSuccess = (userData) => {
    setUser(userData);
  };

  return (
    <div className="bg-gray-900 text-white">
      <Router>
        {/* <Header /> */}
        <div className="container">
          <Routes>
            <Route exact path="/" element={<Authentication onLoginSuccess={handleLoginSuccess} />} />
            <Route path="/forgot-password" element={<ForgotPassword />} />
            <ProtectedRoute path="/dashboard" element={<Dashboard user={user} />} />
            <ProtectedRoute path="/dispose" element={<DisposeMenu />} />
            <ProtectedRoute path="/dispose/:itemType" element={<DisposeForm />} />
            <ProtectedRoute path="/track-order" element={<TrackOrder />} />
            <ProtectedRoute path="/profile" element={<Profile user={user} />} />
            <ProtectedRoute path="/rewards" element={<Rewards />} />
            <ProtectedRoute path="/customer-support" element={<CustomerSupport />} />
            {/* <ProtectedRoute path="/about-us" element={<AboutUs />} /> */}
            <ProtectedRoute path="/settings" element={<Settings />} />
            <ProtectedRoute path="/edit-profile" element={<EditProfile />} />
            <ProtectedRoute path="/login-security" element={<LoginAndSecurity />} />
          </Routes>
        </div>
        {/* <Footer /> */}
      </Router>
    </div>
  );
}

export default App;
